import React from "react";
import ExpenseForm from "./ExpenseForm";
import "./Expense.css";

const NewExpense = () => {
  const expenseDataHandler = (expenseData) => {};
  return (
    <div className="expense container mt-4">
      <ExpenseForm onExpenseData={expenseDataHandler} />
    </div>
  );
};

export default NewExpense;
